script: |
  super -f text -I q12403.spq | sort > q12403.out

inputs:
  - name: q12403.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + col1 NOT BETWEEN 91 - CAST ( col2 AS INTEGER ) AND - + col0 + - col2;
  - name: tab1

outputs:
  - name: q12403.out
    data: |
      51	14	96
      85	5	59
      91	47	68
